import React from 'react';

const DutyManagementPage = () => (
  <div className="bg-white rounded-2xl p-6 shadow-sm border border-slate-200">
    <h2 className="text-2xl font-bold text-slate-900 mb-4">จัดการเวร</h2>
    <p className="text-slate-600">หน้านี้สำหรับจัดการข้อมูลการเข้าเวรของเจ้าหน้าที่</p>
    <p className="mt-4 text-slate-500 italic">(ยังไม่มีฟังก์ชันการทำงานในส่วนนี้)</p>
  </div>
);

export default DutyManagementPage;
